import React from "react";
import {useNavigate} from "react-router-dom";



function Test(props){
    function submithandler(){
        navigate("/login");
    }
    const navigate = useNavigate()
    return (<button onSubmit={submithandler(navigate)} >Hallo</button>)
}

export default Test;
